  `status` int(11) DEFAULT '1' COMMENT '收入1 支出2',
  `addtime` int(11) NOT NULL COMMENT '添加时间',
  `f_lv` int(11) DEFAULT NULL,
  `user_remark` text COMMENT '用户端备注',
  `remark` text COMMENT '后台备注',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `oid` (`oid`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `sid` (`sid`) USING BTREE,
  KEY `status` (`status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2785 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会员-收支明细表';
