  `group_is_active` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '杀猪组是否激活',
  `today_dan` int(11) NOT NULL DEFAULT '0' COMMENT '当天第几单',
  `qkon` int(11) NOT NULL DEFAULT '1',
  `group_completedornot` int(11) NOT NULL DEFAULT '1' COMMENT '多任务是否完成：1未完成,2完成',
  `rands` varchar(50) DEFAULT NULL COMMENT '任务随机数',
  `group_count` varchar(50) DEFAULT NULL COMMENT '折叠总数量',
  `duorw` int(11) NOT NULL DEFAULT '0' COMMENT '是否为多任务1是多任务',
  `rwdans` int(11) DEFAULT NULL,
  `zhuass` int(11) NOT NULL,
