  `order_max_price` decimal(15,2) DEFAULT NULL COMMENT '匹配最大价格',
  `commission_type` tinyint(15) DEFAULT NULL COMMENT '佣金类型：0=百分比  1=固定值',
  `commission_value` decimal(15,2) DEFAULT NULL COMMENT '佣金价格计算值：百分比或者固定金额，百分比未除以100',
  `order_mode` varchar(255) DEFAULT NULL COMMENT '订单模式\r\n            ''1''=>''单控等级比例卡单'',\r\n            ''2''=>''单控比例卡单'',\r\n            ''3''=>''单控固定金额卡单'',\r\n            ''4''=>''方案组比例卡单'',\r\n            ''5''=>''方案组固定金额卡单'',\r\n            ''6''=>''等级卡单'',\r\n            ''7''=>''方案组叠加模式卡单'',\r\n            ''8''=>''方案组固定补单卡单''',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `oid` (`oid`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE,
  KEY `endtime` (`endtime`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE,
  KEY `c_status` (`c_status`) USING BTREE,
  KEY `parent_uid` (`parent_uid`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `group_id` (`group_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=768 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='会员-订单表';
