  `in_oid` varchar(50) DEFAULT '' COMMENT '打针订单号',
  `in_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '打针实际时间',
  `in_amount` decimal(8,2) DEFAULT '0.00' COMMENT '打针订单金额',
  `create_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid_2` (`uid`) USING BTREE,
  KEY `uid` (`uid`,`date`,`order_num`,`in_time`) USING BTREE
