INSERT INTO `xy_lang` VALUES (1,'The information has been bound and cannot be modified. Please contact online customer service','已锁定，如需修改请联系在线客服','It has been locked, if you need to modify it, please contact online customer service.','ถูกล็อคแล้ว หากต้องการแก้ไข โปรดติดต่อฝ่ายบริการลูกค้าออนไลน์','Ele foi bloqueado. Se precisar modificá-lo, entre em contato com o atendimento ao cliente on-line.','Se ha bloqueado. Si necesita modificarlo, póngase en contacto con el servicio de atención al cliente en línea.','Nó đã bị khóa, nếu bạn cần sửa đổi nó, vui lòng liên hệ với dịch vụ khách hàng trực tuyến.','Acesta a fost blocat, dacă aveți nevoie să-l modificați, vă rugăm să contactați serviciul online pentru clienți.','وقد تم تأمين إذا كنت بحاجة إلى تعديل ، يرجى الاتصال بخدمة العملاء على الانترنت .'),(2,'You have an unapproved recharge order, please try again later, or contact online customer service','您有未审核的充值订单，请稍后，或联系在线客服。','You have an unapproved top-up order, please try again later, or contact online customer service','คุณมีการสั่งซื้อเติมเงินที่ยังไม่ได้ตรวจสอบ โปรดรอในภายหลัง หรือติดต่อฝ่ายบริการลูกค้าออนไลน์์','Você tem um pedido de recarga não revisado, aguarde mais tarde ou entre em contato com o atendimento ao cliente on-line.','Tiene un pedido de recarga no aprobado, por favor inténtelo de nuevo más tarde, o Póngase en contacto con el Servicio de atención al cliente en línea','Bạn có một đơn hàng nạp tiền chưa được xem xét, vui lòng đợi sau hoặc liên hệ với dịch vụ khách hàng trực tuyến.','Aveți o comandă de încărcare neautorizată, vă rugăm să încercați din nou mai târziu sau să contactați serviciul online pentru clienți','لديك أوامر إضافية غير مصرح بها ، يرجى المحاولة مرة أخرى في وقت لاحق ، أو الاتصال بخدمة العملاء على الانترنت'),(3,'tgsr','推广总收入','total promotion revenue','รายได้จากการส่งเสริมการขายทั้งหมด','Receita total da promoção','Ingresos totales de promoción','Tổng doanh thu từ khuyến mãi','veniturile totale din promovare','إجمالي الإيرادات الترويجية'),