cripción','Hướng dẫn săn đơn','instrucțiuni de comandă preventivă','الأولوية في التعليم'),(62,'qd_desc_info_1','（1）每天可抓取的帐户数量为30个订单','(1) the number of accounts that can be fetched per day is 30 orders','（1）จำนวนบัญชีที่สามารถรวบรวมข้อมูลได้ต่อวันคือ 30 การสั่งซื้อ','（1）Pode pagar no máximo 30 pedidos','(1) Consigue un número diferente de pedidos y comisiones cada día según tu nivel vip.','（1）Số lượng tài khoản săn mỗi ngày là 30 đơn ','(1) numărul de conturi care pot fi preluate pe zi este de 30 de comenzi','( 1 ) عدد الحسابات التي يمكن استخلاصها يوميا هو 30 أوامر'),(63,'qd_desc_info_2','（2）该渠道的抓单佣金为0.5％','(2) the commission for grasping orders in this channel is 0.5 % ','（2）  ค่าคอมมิชชั่นสำหลับช่องนี้คือ 0. 5%','（2）A comissão de pegar pedidos neste canal é de 0,5%','(2) Si el pedido que obtuvo no se envía y completa dentro del tiempo especificado, el pedido se congelará. Si el tiempo de congelación es demasiado largo, se deducirá el monto de su pedido. Póngase en contacto con el servicio de atención al cliente para obtener ayuda.','（2）Hoa hồng săn đơn kênh này là 0,5% ','(2) comisionul pentru preluarea comenzilor în acest canal este de 0,5%','( 2 ) عمولة الزحف على النظام في هذه القناة هو 0.5 ٪'),(64,'qd_desc_info_3','（3）基于LBS技术,系统通过云自动匹配产品','(3) based on LBS technology, the system automatically matches the product through the cloud','（3） โดยใช้ระบบเทคโนโลยี LBS จับคู่ผลิตภันฑ์อัตโนมัติ','（3）Com base na tecnologia LBS, o sistema combina automaticamente os produtos através da nuvem','(3) Basado en la tecnología LBS, el sistema empareja automáticamente los productos a través de la nube','（3）Dựa trên công nghệ LBS, hệ thống tự động khớp sản phẩm qua đám mây ','(3) pe baza tehnologiei LBS, sistemul se potrivește automat cu produsul prin cloud','( 3 ) على أساس رطل التكنولوجيا ، ونظام مطابقة المنتجات تلقائيا من خلال سحابة'),(65,'qd_desc_info_4','（4）为了消除对平台的监督,如果在匹配后10分钟内未确认并提交订单,系统将冻结订单量24小时,到期后,系统将 自动解冻','(4) in order to eliminate the supervision of the platform, if the order is not confirmed and submitted within 10 minutes after the match, the system will freeze the order for 24 hours, and when it expires, the system will automatically thaw','（4）เพื่อขจัดการควบคุมดูแลของแพลตฟอรม์ หากคำสั่งซื้อไม่ได้รับการยืนและส่งภายใน 10 นาทีหลังจับออเดอร์ ระบบจะอายัดการสั่งซื้อเป็นเวลา 24 ชั่วโมง หลังจากครบเวลาระบบจะยกเลิกการอายัดโดยอัตโนมัติ','（4）A fim de eliminar a supervisão da plataforma, se o pedido não for confirmado e submetido dentro de 10 minutos após a combinação, o sistema congelará o pedido por 24 horas. Após a expiração, o sistema descongelará automaticamente','(4) Para eliminar los descuidos de la plataforma, si una orden no es confirmada y enviada en los 10 minutos siguientes a la coincidencia, el sistema congelará el volumen de la orden durante 24 horas, al expirar, el sistema la descongelará automáticamente','（4）Để tránh sự kiểm soát của nền tảng, nếu không xác nhận đơn và gửi trong 10 phút sau khi khớp lệnh, hệ thống sẽ đóng băng đơn trong 24 giờ, hệ thống tự động bỏ đóng băng khi hết hạn. ','(4) pentru a elimina supravegherea platformei, în cazul în care comanda nu este confirmată și depusă în termen de 10 minute de la meci, sistemul va îngheța comanda timp de 24 de ore, iar atunci când expiră, sistemul se va dezgheța automat','( 4 ) من أجل القضاء على الإشراف على المنصة ، إذا لم يتم تأكيد الطلب وتقديمه في غضون 10 دقائق بعد المباراة ، سيقوم النظام بتجميد النظام لمدة 24 ساعة ، وبعد انتهاء النظام سوف تذويب تلقائيا'),(66,'qd_jywc','交易完成','deal done',' ธุระกรรมเสร็จสิ้น','Conclusão da transacção','La transacción se ha completado',' Giao dịch hoàn tất ','afacere finalizată','إتمام الصفقة'),(67,'qd_buying','订购中','ordering',' กำลังสั่งซื้อ','Pedido em andamento','Pedido','Đang đặt mua','comanda','فرز'),(68,'qb_pay','充值','recharge','เติมเเงิน','Recarregar','Recargar','Nạp tiền','reîncărcare','مشحونة'),(69,'qd_gmwc','支付完成','payment completed','ชำระเสร็จสิ้น','Pagamento concluído','Pago completado',' Thanh toán xong ','plata finalizată