cipales.',' Chào bạn, để đảm bảo quyền lợi của quý khách, vui lòng liên kết đúng số thẻ của 4 ngân hàng lớn (Ngân hàng Trung Quốc, Xây dựng, Công Thương, Nông nghiệp) và thông tin chi nhánh! Nếu điền sai không về tài khoản được, nền tảng sẽ không chịu trách nhiệm. Nền tảng không hỗ trợ rút tiền về các ngân hàng khác ngoài 4 ngân hàng trên. ','Bună ziua, pentru a vă proteja drepturile și interesele, vă rugăm să legați numărul corect de card și informațiile sucursalei celor patru bănci majore (Banca Chinei, Construcții, Industrie și Comerț, Agricultură). Dacă contul nu poate fi atins din cauza unei greșeli, această platformă nu va fi considerată responsabilă! Această platformă nu acceptă retragerile de la alte bănci decât cele patru bănci majore .','مرحبا ، من أجل حماية الحقوق والمصالح الخاصة بك ، يرجى ربط أربعة بنوك كبيرة ( بنك الصين ، بنك التعمير الصينى ، البنك الصناعى التجارى الصينى ، البنك الزراعي ) رقم البطاقة الصحيحة وفرع المعلومات . إذا كان الحساب لا يمكن الوصول إليها بسبب خطأ ، منصة لن تكون مسؤولة عن أي شيء ! هذا البرنامج لا يدعم السحب من البنوك الأربعة الكبرى .'),(160,'bank_set','设置信息','setting information','ข้อมูลการตั้งค่า','Configurar informações','Establecer información',' Đặt thông tin ','stabilirea informațiilor','إعداد المعلومات'),(161,'bank_tixing3','我已同意《服务协议》','I have agreed to the Service Agreement','ฉันได้ตกลงในข้อตกลงการให้บริการ','Eu concordei com o Contrato de Serviço','He aceptado el \"Acuerdo de servicio\"',' Tôi đồng ý với Thỏa thuận dịch vụ ','Am fost de acord cu Contractul de Servicii','لقد وافقت على اتفاق الخدمة'),(162,'bank_tixing4','尊敬的用户,为了保障您的资金安全,请您绑定您的真实姓名和设置取款密码。如果姓名与开户名不一致,将无法取款。','Dear users, in order to ensure the security of your funds, please bind your real name and set the withdrawal password . if the name does not match the name of the account, it will not be possible to withdraw money . ',' ผู้ใช้ที่รัก เพื่อความปลอดภัยของเงินของคุณ โปรดผูกชื่อจริงของคุณและตั้งรหัสผ่านการถอนเงิน หากชื่อไม่ตรงกับชื่อบัญชี จะไม่สามารถถอนเงินไ