DROP TABLE IF EXISTS `xy_level`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `xy_level` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(36) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `level` int(11) DEFAULT NULL COMMENT '等级值',
  `num` decimal(18,2) DEFAULT NULL COMMENT '升级价格',
  `order_num` int(11) DEFAULT NULL COMMENT '抢单次数限制',
  `addtime` datetime DEFAULT NULL,
  `bili` float DEFAULT NULL COMMENT '抢单佣金比例',
  `tj_bili` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '推荐佣金比例',
  `is_invite` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否允许邀请',
  `tixian_ci` int(11) DEFAULT NULL COMMENT '提现次数',
  `tixian_min` decimal(18,2) DEFAULT NULL COMMENT '提现最小金额',
  `tixian_max` decimal(18,2) DEFAULT NULL COMMENT '提现最大金额',
  `num_min` decimal(18,2) DEFAULT NULL COMMENT '抢单余额限制：抢单时账户余额需要大于等于该金额',
  `cids` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `auto_vip_xu_num` int(11) DEFAULT '9999' COMMENT '自动升级vip需要邀请的人',
  `tixian_shouxu` varchar(36) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '0' COMMENT '提现手续费：超出每日免费次数后的提款手续费比例',
  `pic` text COLLATE utf8_unicode_ci,
  `balance_min_amount` decimal(18,2) DEFAULT '0.00' COMMENT '余额最低金额：购买等级时，要求用户账户余额必须大于等于该金额',
  `balance_max_amount` decimal(18,2) DEFAULT NULL COMMENT '余额最高金额：购买等级时，要求用户账户余额不能大于该金额',
  `day_withdraw_num` smallint(4) DEFAULT NULL COMMENT '每天提款次数',
  `day_withdraw_free_num` smallint(4) DEFAULT NULL COMMENT '每天提款免费次数',
  `withdraw_fixed_fee` decimal(18,2) DEFAULT '0.00' COMMENT '提现固定手续费：超出每日免费次数后的固定提款手续费',
  `tixian_nim_order` int(11) DEFAULT NULL COMMENT '提现抢单次数/天：提款时，当前抢单最低次数要求，没有达到不能提款',
  `grab_order_min_amount` decimal(18,2) DEFAULT NULL COMMENT '抢单最低金额',
  `grab_order_max_amount` decimal(18,2) DEFAULT NULL COMMENT '抢单最高金额',
  `grab_order_fixed_commission` decimal(18,2) DEFAULT '0.00' COMMENT '抢单固定佣金',
  `credit` int(10) DEFAULT '0' COMMENT '抢单最低信用限制：信用分高于0才能抢单',
  `auto_buy_finance` tinyint(1) DEFAULT '0' COMMENT '是否自动购买理财产品',
  `lixibao_id` int(10) DEFAULT NULL COMMENT '自动购买理财产品的id',
  `expire_day` int(10) DEFAULT '0' COMMENT '购买等级后，有效天数后过期，0为不限制',
  `promotion_commisssion` tinyint(1) DEFAULT '0' COMMENT '是否享受推广佣金',
  `expire_return_principal` tinyint(1) unsigned DEFAULT '0' COMMENT '到期是否退回本金',
  `sort` int(10) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '状态：0-禁用，1-启用',
  `show_status` tinyint(1) DEFAULT NULL COMMENT '显示状态：0-禁用，1-启用',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `level` (`level`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;
