  `tel` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `num` decimal(15,4) NOT NULL COMMENT '充值金额',
  `num2` decimal(15,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '充值金额2=USDT',
